import React from "react";
import {
  Row,
} from "reactstrap";

import * as Styled from './Contact.style'

function Contact() {
  return (
    <Styled.Container>
    <Row>
        <Styled.Title>
            <h1>PLATAFORMA</h1>
            <p>El servidor en la nube ofrece el monitoreo remoto desde cualquier dispositivo inteligente, brindándole supervisión en tiempo real de sus productos y procesos.</p>
        </Styled.Title>
    </Row>
    <Styled.CardContainer>
        {PlatformArray.map((item) => {
            return (
                    <Styled.Card>
                        <div className="header-div">
                            <img alt={item.title} src={item.img}/>
                            <h4>{item.title}</h4>
                        </div>
                        <div className="text-div">
                            <p>{item.text}</p>
                        </div>
                    </Styled.Card>
            )
        })}
    </Styled.CardContainer>
</Styled.Container>
  )
}

export default Contact
